import { useState, useEffect } from "react";
import { api } from "../services/api";

export default function Treinamentos() {
  const [treinamentos, setTreinamentos] = useState([]);

  useEffect(() => {
    api.get("treinamentos/").then((res) => setTreinamentos(res.data));
  }, []);

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold">Lista de Treinamentos</h1>
      <ul className="mt-4">
        {treinamentos.map((t) => (
          <li key={t.id} className="p-2 bg-blue-100 my-2 rounded">
            {t.titulo} - {t.carga_horaria} horas
          </li>
        ))}
      </ul>
    </div>
  );
}
